import { lazy, Suspense } from 'react';
const ProjectGallery = lazy(() => import('./components/ProjectGallery'));

function App() {
  return (
    <div>
      <h1>Welcome to PBJ Fire</h1>

      <Suspense fallback={<div>Loading...</div>}>
        <ProjectGallery />
      </Suspense>
    </div>
  );
}

export default App;
